    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1958.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, fish, and reptiles- is
    also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, and prescribed fires. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes Refuge visitors, Refuge participation, and violations. N-R forms and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
